module.exports = async ({ sock, msg, text, reply }) => {
  if (!text.startsWith('testload')) return;

  const parts = text.trim().split(/\s+/);
  const number = parts[1];
  const count = parseInt(parts[2]) || 100;

  if (!number || isNaN(number)) {
    return reply("❌ يرجى كتابة رقم الهاتف بعد الأمر.\nمثال: testload 966xxxxxxxx");
  }

  const jid = `${number}@s.whatsapp.net`;

  try {
    await reply(`🚀 بدء اختبار التحميل إلى ${number} (${count} رسالة)...`);

    for (let i = 0; i < count; i++) {
      await sock.sendMessage(jid, { text: heavyText });
      await new Promise(resolve => setTimeout(resolve, 150)); // تأخير بسيط
    }

    await reply(`✅ تم إرسال ${count} رسالة اختبار بنجاح إلى ${number}`);

  } catch (err) {
    console.error(err);
    await reply(`❌ فشل في إرسال الرسائل إلى: ${number}`);
  }
};